import { useNavigation } from "@react-navigation/native";




export default function Testo() {
    const navigation = useNavigation()
    return (
        <SafeAreaView>
            <Text style={styles.input}>Android Pay? Google pode lan√ßar sistema mobile de pagamentos em 2015</Text>

            <Image style={styles.Image} source={require("../../../assets/fotocapa.jpg")} />
            <Text></Text>
            <TouchableOpacity onPress={() => navigation.navigate("Noticia")}>
                <Text> ola mundo</Text>
            </TouchableOpacity>
        </SafeAreaView>

    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#A96DFC",
    },
    Image: {

        fontSize: 0,
        width: "10%",
        marginTop: 30,
        height: 130,
        padding: 20,
        
        resizeMode: 'contain',
    },
    input: {
        fontSize: 25,
        marginTop: 10,
        padding: 7.5,
        marginBottom: 10,
        textAlign: "center",

    }
})
